    false,nt"url": null,nt"notes": "Bottomfish Sampling data collected on research
    cruises aboard the Oscar Elton Sette (OES/SE). Additional information about physical
    specimens collected during OES/SE cruises conducted within waters surrounding the
    Main and Northwestern Hawaiian Islands can be found in the Bottomfish Sampling Data
    dataset. THIS IS THE GENERAL LAYOUT FOR FISHING LOCATION DATA, which VARIES DEPENDING
    ON THE PROJECT (IF TRAPPING OCCURRED OR BOTCAM WAS USED, TAGGING, SHARK DOCUMENTATION
    ETC.) MODIFIED SLIGHTLY FOR EACH CRUISE DEPENDING ON OBJECTIVES.  USED ON ALL RESEARCH
    CRUISES ABOARD THE SETTE REGARDLESS OF LOCATION (MHI, JOHNSTON, MARIANA ISLANDS
    ETC.) AND SMALL BOAT FISHING OPS.ttt",nt"license_title": null,nt"extras":
